use crate::Solution;

#[test]
// #[ignore]
fn case_1() {
    assert!(
        Solution::longest_palindrome_check_all(("babad").to_string()) == "bab"
            || Solution::longest_palindrome_check_all(("babad").to_string()) == "aba"
    );
    // assert!(
    //     Solution::longest_palindrome_dynamic(("babad").to_string()) == "bab"
    //         || Solution::longest_palindrome_dynamic(("babad").to_string()) == "aba"
    // );
}

